import BookingPage from "./components/booking/BookingPage";

export default function App() {
  return (
    <div>
      <h1 style={{ textAlign: "center", margin: "20px 0" }}>
        Đặt lịch dịch vụ EV
      </h1>
      <BookingPage />
    </div>
  );
}
